import React from 'react';
import './About.css';

const About = () => {
  const interests = [
    {
      title: "Dancing",
      icon: "fas fa-music",
      description: "Actively engages in dance performances, contributing vibrant energy to festivals and events.",
      color: "#6c63ff"
    },
    {
      title: "Cooking",
      icon: "fas fa-utensils",
      description: "Passionate about making different and delicious dishes.",
      color: "#ff6b6b"
    },
    {
      title: "Drawing & Rangoli",
      icon: "fas fa-palette",
      description: "Bagged few prizes, showcasing creativity and precision in every stroke.",
      color: "#8b5cf6"
    }
  ];

  const achievements = [
    {
      title: "Quasar National-Level Hackathon Finalist",
      description: "Built a Learning Path Dashboard (Top 60 out of 650+ teams)",
      image: "../assets/hackathon.jpg"
    },
    {
      title: "4th Rank in CodeAthon",
      description: "Competed among top teams, solving complex challenges with innovative solutions.",
      image: "../assets/codeathon.jpg"
    },
    {
      title: "1st Prize in Project Competition",
      description: "Software Domain (2023-2024)",
    },
    {
      title: "1st Position in Technical Paper Presentation",
      description: "State Level Competition (2023-2024)",
    },
    {
      title: "1st Prize in Elocution Competition",
      description: "State Level Competition (2023-2024)",
    },
    {
      title: "Pre-Secondary Scholarship",
      description: "133rd Rank in Maharashtra and 1st Rank in School (2018-2019)",
    },
    {
      title: "NELTAS ECAT Grand Finale",
      description: "Certificate & Medal for Scoring 80% in National Level (2018-2019)",
    }
  ];

  const certifications = [
    {
      title: "DBMS Certification",
      period: "2024",
      description: "1st Position - Awarded for excellence in Database Management Systems",
      image: "../assets/dbms.jpg"
    },
    {
      title: "Social Service Internship",
      period: "09/2024 - 11/2024",
      description: "Taught English to students from 1st to 8th standard"
    },
    {
      title: "Android App Development",
      period: "February 2024",
      description: "Using Kotlin - Scored 90%"
    },
    {
      title: "Linux Training",
      period: "November 2023",
      description: "Scored 83.33%"
    },
    {
      title: "Infosys Course",
      period: "October 2023",
      description: "Introduction to Artificial Intelligence"
    },
    {
      title: "Web Development Internship",
      period: "April - July 2023",
      description: "Lotus Educare Academy"
    }
  ];

  return (
    <section className="about" id="about">
      <div className="about-header">
        <h2>About Me</h2>
        <p>Get to know me better</p>
      </div>

      <div className="about-content">
        <div className="interests-section">
          <h3>Interests</h3>
          <div className="interests-grid">
            {interests.map((interest, index) => (
              <div className="interest-card" key={index} style={{'--accent-color': interest.color}}>
                <div className="interest-icon">
                  <i className={interest.icon}></i>
                </div>
                <h4>{interest.title}</h4>
                <p>{interest.description}</p>
              </div>
            ))}
          </div>
        </div>

        <div className="achievements-section">
          <h3>Achievements</h3>
          <div className="achievements-grid">
            {achievements.map((achievement, index) => (
              <div className="achievement-card" key={index}>
                {achievement.image && (
                  <div className="achievement-image">
                    <img src={achievement.image} alt={achievement.title} />
                  </div>
                )}
                <div className="achievement-content">
                  <h4>{achievement.title}</h4>
                  <p>{achievement.description}</p>
                </div>
              </div>
            ))}
          </div>
        </div>

        <div className="certifications-section">
          <h3>Certifications</h3>
          <div className="certifications-timeline">
            {certifications.map((cert, index) => (
              <div className="certification-item" key={index}>
                {cert.image && (
                  <div className="certification-image">
                    <img src={cert.image} alt={cert.title} />
                  </div>
                )}
                <div className="certification-content">
                  <h4>{cert.title}</h4>
                  <span className="period">{cert.period}</span>
                  <p>{cert.description}</p>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default About;
